        _etnCall = etnCall_;
    }

    function withdrawTo(
        address to,
        Data.IncomingMessage calldata message
    ) external virtual override onlyETNCall {
        _withdrawTo(to, message);
    }

    function _withdrawTo(
        address to,
        Data.IncomingMessage calldata message
    ) internal virtual;

    error InvalidRouter(address router);

